import './App.css';
import React, {useState, useEffect} from 'react';
import axios from 'axios';

function App() {

  const url ="https://jsonplaceholder.typicode.com/users";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return axios.get(url)
      .then((res) => setData(res.data));
  }

  useEffect(() => {
    fetchInfo()
  }, [])

  return (
    <div className="App">
        <h1>List of Users</h1>
        {/* Rendering list of names from users data */}
        <div>
          {
            data.map((dataObj, index) => {
              return (
                <div style={{width: '15em', backgroundColor: 'lightgray', padding: 2, borderRadius: 10, marginInline: 10}}>
                  <p>{dataObj.name}</p>
                </div>
              )
            })
          }
        </div>
    </div>
  );
}

export default App;
